import { useEffect } from "react";

export default function useEffectExample({name}) {
  const message = `Hello, ${name}!`;   // Calculates output
  useEffect(() => {
    // Good!
    document.title = `Greetings to ${name}`; // Side-effect!
  }, [name]);

  return <div>
    <h1>oke</h1>
    {message}

    </div>;  
}
